            <p class="text-left">
                Desa Wasuemba merupakan salah satu desa di Kecamatan Wabula Kabupaten Buton, Provinsi Sulawesi Tenggara,
                memilik luas 4500 Ha yang terdiri dari 60 Ha berupa pemukiman Existing, 808 Ha berupa Pengembangan
                Pemukiman, 55 Ha Berupa Pesisir Pantai, 1000,4
                Ha Berupa Perkebunan Kelapa, 2000,4 Ha Berupa Perkebunan Campuran, sisanya 576,2 Ha merupakan pertanian
                Lahan Kering. Secara Administratif, wilayah Desa Wasuemba terdiri dari 4 (empat) Dusun yaitu Dusun
                Wasuemba,Dusun Ngapa, Dusun Bantea dan
                dusun Piropa.
            </p>
            <p class="text-left">
                Desa wasuemba memiliki banyak hal menarik dan unik yang dapat di suguhkan bagi para pengunjung /
                wisatawan
                yang datang ke tempat ini. Dari segi wisata budaya di Desa wasuemba ini sendiri mempunyai benteng yang
                masih
                berdiri letaknya yang hanya 200 meter
                dari gedung information center dapat di tempuh dengan berjalan kaki, benteng ini berdiri sejak zaman
                kerajaan Buton dan memiliki ikatan dengan benteng terluas di dunia dan perjalanan Oputa Yiko yang
                merupakan
                pahlawan nasional. Bukti peninggalan
                sejarah pun masih dapat di liat seperti meriam, kuburan penjaga benteng pada masa itu, dan situs lain.
                Dari
                segi wisata pantai yang terkenal langka dan unik di Kabupaten Buton yakni pantai lahonduru,
            </p>
